import { USER } from "./actionTypes";

export const dispatchDeal = (payload: number) => ({
    type: USER.DEAL,
    payload
});


export const dispatchSelectable = (type: string, payload: any) => (
    {
        type: type === "JOB" ? USER.JOB : USER.COUNTRY,
        payload
    }
)
